    "distribution-and-abundance-of-seabirds-over-marine-waters-of-the-eastern-aleutian-islands",nt"isopen":
    false,nt"url": null,nt"notes": "Like the Pribilof Islands, the eastern
    Aleutian islands are located rather strategically in an area where seabirds have
    short flying time access to a variety of marine environments including a broad continental
    shelf, rather precipitous shelfbreak areas, and deep oceanic expanses. There are
    31 species of marine birds which are common breeders in the eastern Aleutian Islands
    and 27 others which are common in winter or during migration.",nt"license_title":
